import React from 'react';
import '../Styles/style_section.scss';

function Section11() {
  return (
    <div>
        <div className='background-color11 alignItem '>
        <div className='text-center'>
            <div class="text-4xl font-bold pt-1">Our Key Supports</div> 
            <div>
            <div class="box-border h-32 w-32 p-4 shadow-2xl"> 
            </div>
            </div>
        </div>

        </div>
    </div>
  )
}

export default Section11
